import React from 'react';
import TaskItem from './TaskItem'; // Importamos el componente TaskItem
import "./ListStyle.css";

const TaskDone = ({ tasks, onToggle, onDelete, onEdit }) => {//las ppropiedades como argumentos
    const tasksToDo = tasks.filter(task => task.completed);

    return (
        <ul className="listaTareas">
        {tasksToDo.map((task) => (
          <TaskItem
            key={task.id}
            task={task}
            onToggle={onToggle}
            onDelete={onDelete}

          />
        ))}
      </ul>

    );


};

export default TaskDone;
